import React, { useState } from "react";  // Import React and useState
import axios from "axios";  // Import axios for HTTP requests
import { useNavigate } from "react-router-dom";  // Import useNavigate for routing
import minimalist2 from "../assets/minimalist2.jpg";  // Import image paths
import minimalist3 from "../assets/minimalist3.jpg";  // Import image paths

// Main component
const Personal_1_login = () => {
  const [username, setUsername] = useState("");  // State to store username
  const [password, setPassword] = useState("");  // State to store password
  const [alertMessage, setAlertMessage] = useState("");  // State to store alert message
  const [alertType, setAlertType] = useState("");  // State to store alert type (error/success)
  const [shake, setShake] = useState(false);  // State to trigger shake animation

  const navigate = useNavigate();  // Hook to navigate to different routes

  // Form submission handler
  const onSubmit = async (event) => {
    event.preventDefault();

    try {
      // Make an API call to the login endpoint
      const result = await axios.post("/auth/personal1-login", {
        username,
        password,
      });

      // Store the user ID in localStorage and navigate to the dashboard
      window.localStorage.setItem("userID", result.data.userID);
      navigate("/Fetchalldata1proc");

      // Show success message
      setAlertMessage("Logged in successfully");
      setAlertType("success");
    } catch (error) {
      // Show error message and trigger shake animation
      setAlertMessage("Incorrect credentials");
      setAlertType("error");
      setShake(true);

      // Remove the shake class after animation ends
      setTimeout(() => setShake(false), 500);

      console.error(error);
    }
  };

  // Navigate to the registration page
  const navigateToRegister = () => {
    navigate("/register");
  };

  return (
    <div className="login">
      <img className="useru-logo" src={minimalist2} alt="Logo 1" />
      <img className="userp-logo" src={minimalist3} alt="Logo 2" />

      {/* Alert Message outside the form */}
      {alertMessage && (
        <div className={`alert-all ${alertType} slideIn`}>
          {alertMessage} <br />
          <button className="close" onClick={() => setAlertMessage("")}>
            Close
          </button>
        </div>
      )}

      {/* Form for login */}
      <form onSubmit={onSubmit} className={shake ? "shake" : ""}>
        <h4 className="login-name">Personal 1</h4>

        <div className="form-group">
          <input
            type="text"
            id="username"
            placeholder="Username"
            value={username}
            onChange={(event) => setUsername(event.target.value)}  // Update username state
          />
        </div>

        <div className="form-group">
          <input
            type="password"
            id="password"
            placeholder="Password"
            value={password}
            onChange={(event) => setPassword(event.target.value)}  // Update password state
          />
        </div>

        {/* Submit image button */}
        <img 
          src={require('../assets/login.png')} 
          alt="Submit" 
          className="submit-img" 
          onClick={onSubmit} 
        />
      </form>

      {/* Circular button to navigate to the register page */}
      <button className="change" onClick={navigateToRegister}>
        тин
      </button>
    </div>
  );
};

export default Personal_1_login;




